    return (
        <div className="homescreen">
           <Nav />
            <Banner />

            <Row title="NETFLIX ORIGINALS" fetchUrl={request.fetchNetflixOrginals}
            isLargeRow/>


            <Row title="Trending Now" fetchUrl={request.fetchTrending} />
            <Row title="Comedy" fetchUrl={request.fetchTrending} />
            <Row title="Documentaries" fetchUrl={request.fetchActionMovies} />
            <Row title="Horror" fetchUrl={request.fetchHorrorMovies} />
            <Row title="Trending Now" fetchUrl={request.fetchNetflixOrginals} />
            <Row title="Trending Now" fetchUrl={request.fetchTrending} />
            <Row title="Trending Now" fetchUrl={request.fetchTrending} />

        </div>
    );
}

export default HomeScreen;
